import React from "react";


export class Login extends React.Component{
    constructor(props){
        super(props);
    }

    render() {
        return(
            <div className="base-container">
                <div className="header">Login</div>
                <div className="content">
                    <div className="form">
                        <div className="form-group">
                            <label htmlFor="username"></label>
                            <input type="text"/>
                        </div>
                    </div>
                </div>
            </div>
        )
    }
}
